import React from 'react'
import { useFeed } from './util/hooks'

const Feed = () => {
  const { feed } = useFeed()

  return (
    feed ? (
      <>
        {feed.map((item, i) => {
          <li key={i}>
            <p>item</p>
          </li>
        })}
      </>
    ): null
  )
}

export default Feed
